import React from 'react';
import NavigationBar from './components/NavigationBar';
import SubNavigationBar from './components/SubNavigationBar';
import Maps from './components/Maps';
import Forms from './components/Forms';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


class Home extends React.Component {
  render() {
    return (
      <div>

          <NavigationBar />

          <SubNavigationBar />

          <Container fluid = {true} className = "section-contact" style = {{display: "flex", justifyContent: "center", textAlign: "center"}}>
            <Row className = "justify-content-md-center">
              <Col className = "col-contact">
                <h1 className = "title-contact">Contact</h1>
              </Col>
            </Row>
            <Row>
              <Col className = "google-map" lg = {5} md = {11} sm = {10} xs = {10} style = {{height: '350px', margin: '20px 20px 20px 20px'}}>
                <Maps />
              </Col>
              <Col className = "form" lg = {6} md = {12} style = {{margin: '20px 20px 20px 20px'}}>
                <Forms/>
              </Col>
            </Row>
          </Container>

      </div>
);}}

export default Home;
